import{_ as o,c as t,o as a,a4 as s}from"./chunks/framework.DBIahkuf.js";const e="/AINotes/assets/1689683296176-148.BFNJ03Wg.png",r="/AINotes/assets/1689683296175-127.DlohcHLZ.png",p="/AINotes/assets/1689683296175-128.DUSqdz-E.jpeg",i="/AINotes/assets/1689683296175-129.BuCRdrSv.png",n="/AINotes/assets/1689683296175-130.Bsb0foOy.png",l="/AINotes/assets/1689683296175-131.DRfwHT5T.png",c="/AINotes/assets/1689683296175-132.R9H1FEKH.jpeg",m="/AINotes/assets/1689683296176-133.B_yWWQw9.png",g="/AINotes/assets/1689683296176-134.C0uE894H.png",_="/AINotes/assets/1689683296176-135.DUnfK78J.png",d="/AINotes/assets/1689683296176-136.BKYQZ2EM.png",h="/AINotes/assets/1689683296176-137.CvcDX3kl.png",u="/AINotes/assets/1689683296176-138.RIWnrREO.png",A="/AINotes/assets/1689683296176-139.FPwksiw8.png",I="/AINotes/assets/1689683296176-140.Cu10j8D9.png",f="/AINotes/assets/1689683296176-141.BEed0nc7.png",N="/AINotes/assets/1689683296176-142.C1nxCnHj.png",b="/AINotes/assets/1689683492113-189.CF6mFuAA.png",q="/AINotes/assets/1689683296176-144.BOeruU6-.png",L="/AINotes/assets/1689683532915-192.DztBwQBc.png",D="/AINotes/assets/1689683553904-198.CpbIsf6o.png",H=JSON.parse('{"title":"Leonardo.AI 注册","description":"","frontmatter":{},"headers":[],"relativePath":"Document/AI绘画工具/Leonardo.AI绘画工具/Leonardo.AI注册.md","filePath":"Document/AI绘画工具/Leonardo.AI绘画工具/Leonardo.AI注册.md","lastUpdated":1689691980000}'),k={name:"Document/AI绘画工具/Leonardo.AI绘画工具/Leonardo.AI注册.md"},C=s('<h1 id="leonardo-ai-注册" tabindex="-1">Leonardo.AI 注册 <a class="header-anchor" href="#leonardo-ai-注册" aria-label="Permalink to &quot;Leonardo.AI 注册&quot;">​</a></h1><h2 id="写在前面的话" tabindex="-1">写在前面的话 <a class="header-anchor" href="#写在前面的话" aria-label="Permalink to &quot;写在前面的话&quot;">​</a></h2><p>这款软件无需使用魔法上网，国内用户直接可以使用，生成的图片质量也非常不错，可以作为 Midjourney 的替代品。</p><p>Leonardo 是一个 AI 绘画社区，同时也是一个 AI 绘画工具。</p><p>Leonardo 是基于 Stable Diffusion 的网站，同时深度集成了 Stable Diffusion 的各种插件，比如 ControlNET 的 openpose 姿势参考、局部重绘、prompt 提示等等，甚至还提供了傻瓜式在线训练自己模型的功能。</p><p>对 Stable Diffusion 了解比较多的人可能会知道一个 Stable Diffusion 模型分享社区–<a href="http://civitai.com/" target="_blank" rel="noreferrer">civitai.com</a>（魔法）。而 Leonardo 更像是 Civtai 和 Stable Diffusion 的集合体。</p><h3 id="纯文字教程" tabindex="-1">纯文字教程 <a class="header-anchor" href="#纯文字教程" aria-label="Permalink to &quot;纯文字教程&quot;">​</a></h3><p>Leonardo 注册教程：</p><ol><li>打开官网 <a href="https://leonardo.ai/" target="_blank" rel="noreferrer">https://leonardo.ai/</a> ，在输入框中输入邮箱，点击右侧&quot;Count me in&quot;加入。</li><li>加入 Discord 社区，选择中文语言，同意使用规则。</li><li>在左侧找到&quot;priority-early-access&quot;频道，点击蓝色链接，填写白名单资料并提交。</li></ol><p>Leonardo 使用教程：</p><ol><li>打开官网 <a href="https://leonardo.ai/" target="_blank" rel="noreferrer">https://leonardo.ai/</a> ，点击右上角的&quot;Launch App&quot;。</li><li>点击&quot;Sign Up&quot;，输入邮箱和密码注册，验证邮箱即可登录。</li><li>登录后点击左边菜单的&quot;AI Image Generation&quot;，即可开始生成图片。</li></ol><p>生成的图片可以进行精修，以获得更美观的效果。Leonardo 集成了很多训练好的模型，用户可以选择适合自己的模型进行绘画。在社区里，可以看到很多其他用户创作的优秀作品，并可以参照这些作品使用。此外，用户也可以训练自己的模型。</p><p>Leonardo 还有很多其他功能，大家可以慢慢探索体验。</p><p>平台采用代币制，每人每天有 250 个 token，渲染一张图大概需要 3~8 个 token，如果不是高频使用，一天的 token 绝对够用。</p><p>下面是详细的图文注册教程</p><h3 id="eonardo-ai-注册图文教程" tabindex="-1"><strong>eonardo.ai 注册图文教程</strong> <a class="header-anchor" href="#eonardo-ai-注册图文教程" aria-label="Permalink to &quot;**eonardo.ai 注册图文教程**&quot;">​</a></h3><p>首先打开官网地址：<a href="https://leonardo.ai/" target="_blank" rel="noreferrer">https://leonardo.ai/</a> 然后在输入框中输入你的邮箱，点击右侧 Count me in 加入。</p><p><img src="'+e+'" alt="img"></p><p>然后加入 Discord 社区，Discord 也是用 midjourney 那个软件，这里需要用一下魔法。</p><p><img src="'+r+'" alt="img"></p><p>点击加入，然后可以选择语言，就选一个中文就可以了，第二个可以跳过。</p><p><img src="'+p+'" alt="img"></p><p><img src="'+i+'" alt="img"></p><p>然后后面按还有两个选择，按图下选就行，选择完成之后还要同意一下使用规则。</p><p><img src="'+n+'" alt="img"></p><p><img src="'+l+'" alt="img"></p><p><img src="'+c+'" alt="img"></p><p><img src="'+m+'" alt="img"></p><p>然后在左侧找到 priority-early-access 这个频道，然后点击这个蓝色链接。</p><p><img src="'+g+'" alt="img"></p><p>然后填写白名单资料，填写完成点击提交就可以了。</p><p><img src="'+_+'" alt="img"></p><p><img src="'+d+'" alt="img"></p><h3 id="eonardo-ai-使用图文教程" tabindex="-1"><strong>eonardo.ai 使用图文教程</strong> <a class="header-anchor" href="#eonardo-ai-使用图文教程" aria-label="Permalink to &quot;**eonardo.ai 使用图文教程**&quot;">​</a></h3><p>注册完成之后，我们再次打开官网，<a href="https://leonardo.ai/" target="_blank" rel="noreferrer">https://leonardo.ai/</a> ，点击右上角的 Launch App。</p><p><img src="'+h+'" alt="img"></p><p>然后按步骤点击。</p><p><img src="'+u+'" alt="img"></p><p><img src="'+A+'" alt="img"></p><p><img src="'+I+'" alt="img"></p><p>点 sign up，再输入邮箱和密码注册，然后邮箱会有一个验证码，登录即可。</p><p><img src="'+f+'" alt="img"></p><p><img src="'+N+'" alt="img"></p><p>登录之后点击左边菜单的 AI lmage Generation</p><p><img src="'+b+'" alt="img"></p><p>然后就可以开始生成图片了。</p><p><img src="'+q+'" alt="img"></p><p>生成后的图片还能进行精修，精修之后才好看。</p><p><img src="'+L+'" alt="img"></p><p>Leonardo 集成了很多训练好的模型。你可以选择适合的模型进行绘画。在社区里，你可以看到非常多的，由其他用户创作的优秀作品，基于这些作品，你可以直接参照使用。有意思的是，你还可以训练自己的模型。</p><p>平台采用代币制，每人每天 250 个 token，渲染一张图大概 3~8token 不等，基本上如果不是高频式的疯狂用，一天绝对够了。</p><p><img src="'+D+'" alt="img"></p>',52),S=[C];function B(P,x,E,T,y,v){return a(),t("div",null,S)}const R=o(k,[["render",B]]);export{H as __pageData,R as default};
